function getSubNavList(pathHead){
    const navItem= {
        pathHead,
        navList:[
            {'path':`/${pathHead}/list`,'key':`topNav/${pathHead}/list`,'title':`${pathHead} List`},
            {'path':`/${pathHead}/add`,'key':`topNav/${pathHead}/add`,'title':`Add ${pathHead}`},
            {'path':`/${pathHead}/upload`,'key':`topNav/${pathHead}/upload`,'title':`Upload ${pathHead} Spreadsheet`},
        ]
    }
    return navItem
} 
const studentsNav_list= getSubNavList('students')
const schoolssNav_list= getSubNavList('schools')
const volunteersNav_list= getSubNavList('volunteers')
const eventsNav_list= getSubNavList('events')
const usersNav_list= getSubNavList('users')

console.log(studentsNav_list)

export{studentsNav_list,schoolssNav_list,volunteersNav_list,eventsNav_list,usersNav_list}
